    <div id="Stattdessen_wird_es_fr_die_Fin">
      <span>Stattdessen wird es für die Finanzierung von z.B. Kohlekraftwerken oder Kinderarbeit verwendet. <br/><br/>Mit </span><span style="font-style:normal;font-weight:bold;color:rgba(3,49,108,1);">birds of trust </span><span>ist damit Schluss. Suche dir hier nachhaltige Anbieter, die dir versichern, dass sie das Geld nur zur Finanzierung von grünen und sozialen Projekten verwenden. Geld verdienen und dabei Gutes tun.</span><br/>
    </div>
    <div id="Wir_von_birds_of_trust_sind_be">
      <span>Wir von </span><span style="font-style:normal;font-weight:bold;color:rgba(3,49,108,1);">birds of trust </span><span>sind überzeugt davon, dass die Hebelwirkung von nachhaltigen Finanzprodukten immer noch unterschätzt wird. <br/><br/>Mit einer unabhängigen Vergleichsplattform unterschiedlicher nachhaltiger Finanzprodukte wie dieser, können wir zu mehr Transparenz und einer nachhaltigen Zukunft beitragen. </span>
    </div>
